pragma solidity ^0.4.24;

contract LibOrder {

    bytes32 constant ORDER_SCHEMA_HASH = keccak256(
        "address exchangeAddress",
        "address makerAddress",
        "address takerAddress",
        "address feeRecipientAddress",
        "address senderAddress",
        "uint256 makerAssetAmount",
        "uint256 takerAssetAmount",
        "uint256 makerFee",
        "uint256 takerFee",
        "uint256 expirationTimeSeconds",
        "uint256 salt",
        "bytes makerAssetData",
        "bytes takerAssetData"
    );

    struct Order {
        address makerAddress;
        address takerAddress;
        address feeRecipientAddress;
        address senderAddress;
        uint256 makerAssetAmount;
        uint256 takerAssetAmount;
        uint256 makerFee;
        uint256 takerFee;
        uint256 expirationTimeSeconds;
        uint256 salt;
        bytes makerAssetData;
        bytes takerAssetData;
    }

    struct OrderInfo {
        // See LibStatus for a complete description of order statuses
        uint8 orderStatus;
        // Keccak-256 EIP712 hash of the order
        bytes32 orderHash;
        // Amount of order that has been filled
        uint256 orderTakerAssetFilledAmount;
    }

    /// @dev Calculates Keccak-256 hash of the order.
    /// @param order The order structure.
    /// @return Keccak-256 EIP712 hash of the order.
    function getOrderHash(Order memory order)
        internal
        view
        returns (bytes32 orderHash)
    {
        // TODO: EIP712 is not finalized yet
        // Source: https://github.com/ethereum/EIPs/pull/712
        orderHash = keccak256(
            ORDER_SCHEMA_HASH,
            keccak256(
                address(this),
                order.makerAddress,
                order.takerAddress,
                order.feeRecipientAddress,
                order.senderAddress,
                order.makerAssetAmount,
                order.takerAssetAmount,
                order.makerFee,
                order.takerFee,
                order.expirationTimeSeconds,
                order.salt,
                order.makerAssetData,
                order.takerAssetData
            )
        );
        return orderHash;
    }
}

